import React from 'react'
import SwatchDiv from './SwatchDiv'

import SwatchPickerStyle from './SwatchPickerStyle'

const Swatch = (props) => {
	//edit swatch
	//maybe convert here?
	console.log(props)

	return (
		<SwatchPickerStyle>
			<div className='swatch-container m-3'>
				<div className='d-flex justify-content-start'>
					{props.swatch.colors.slice(1).map((color, index) => (
						<SwatchDiv bg={color} key={index} />
					))}
				</div>
				<div className='d-flex justify-content-between'>
					<p>{props.swatch.name}</p>
					<button className='m-1'>Save</button>
				</div>
			</div>
		</SwatchPickerStyle>
	)
}

export default Swatch
